insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56843','0','0','You there! In the rafters! My sacred library has become possessed by the Sha!','12','0','100','0','0','30887','Talk of lorewalkter stonestep 0');
insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56843','1','0','See how they pour from every letter of these sacred scrolls... corrupting them! Defiling them!','12','0','100','0','0','30888','Talk of lorewalkter stonestep 1');
insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56843','2','0','I beseech you, kind strangers. Cleanse this place of their foul presence! Lay our stories to rest!','12','0','100','0','0','30889','Talk of lorewalkter stonestep 2');
insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56843','3','0','You must destroy the source of the corruption! Quickly, before our cherished history is erased forever!','12','0','100','0','0','30890','Talk of lorewalkter stonestep 3');
insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56843','4','0','Oh, my. If I am not mistaken, it appears that the tale of Zao Sunseeker has come to life before us.','12','0','100','0','0','30901','Zao appears 0');
insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56843','5','0','According to the legend, long ago, there were five suns that burned brightly in the sky. When the winds blew, their intense heat caused great wildfires.','12','0','100','0','0','30902','Zao appears 1');
insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56843','6','0','Crops wilted, villages burned, and families wandered endlessly to seek refuge from the flames...','12','0','100','0','0','30903','Zao appears 2');
insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56843','7','0','I can allow this no longer!','12','0','100','0','0','27747','Zao appears 3');
insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56843','8','0','The fires, they are burning the library! Please, heroes! Purge this evil before the temple crumbles to ash!','12','0','100','0','0','30904','Zao appears 4');
insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56843','9','0','Zao has become corrupted too! Please, fight him with dignity...','12','0','100','0','0','30906','Zao enters combat 0');
insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56843','10','0','Ah, it is not yet over. From what see, we face the trial of the yaungol. Let me shed some light...','12','0','100','0','0','0','trial appears 1');
insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56843','11','0','As the tale goes, the yaungol was traveling across the Kun\'lai plains when suddenly he was ambushed by two strange creatures!','12','0','100','0','0','0','trial appears 2');
insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56843','12','0','The yaungol attacked the beasts with great determination and ferocity. Yet, the more he attacked, the more fearsome the beasts grew!','12','0','100','0','0','0','trial appears 3');
insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56843','13','0','However, when he let it alone, the beast shrank to near nothingness.','12','0','100','0','0','0','trial appears 4');
insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56843','14','0','For you see, strife feeds on conflict. when you have peace in your heart, strife will find somewhere else to roam.','12','0','100','0','0','0','trial appears 5');
insert into `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `comment`) values('56872','0','0','FOR THE ANCIENTS!','12','0','100','0','0','0','EnterCombat Osong');
